// src/components/Dashboard/Navbar.js

import React from 'react';
import { AppBar, Toolbar, Typography, Box, InputBase, Button } from '@mui/material';
import { Search, AccountCircle } from '@mui/icons-material';

const Navbar = () => {
    return (
        <AppBar position="static" color="default" elevation={0} sx={{ borderBottom: '1px solid #e0e0e0' }}>
            <Toolbar>
                <Typography variant="h6" sx={{ flexGrow: 1 }}>
                    CourseConnect
                </Typography>
                <Button color="inherit">Dashboard</Button>
                <Button color="inherit">Tasks</Button>
                <Box sx={{ mx: 2, display: 'flex', alignItems: 'center', backgroundColor: '#f4f4f9', borderRadius: '4px', px: 2 }}>
                    <Search sx={{ mr: 1 }} />
                    <InputBase placeholder="Search for a user" />
                </Box>
                <Button color="inherit">Updates</Button>
                <Button color="inherit">Sign Out</Button>
                <AccountCircle sx={{ ml: 2 }} />
            </Toolbar>
        </AppBar>
    );
};

export default Navbar;
